import React, {Component} from "react";

class File extends Component{
    render() {
        // const firstName = "Afraa";
        // const lastName = "Hakouk";
        return(
            <h1> {this.props.firstName} {this.props.lastName} {this.method("Is a WebDesigner")}</h1>
        );
    }
    method(position) {
        return(
            <h1> {position} </h1>
        );
    }
};

export default File;
